import React, { useState } from "react";
import emailjs from "@emailjs/browser";

const Booking = () => {
  const [form, setForm] = useState({
    pc: "",
    time: "",
    name: "",
    email: "", // user-entered email
  });

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleBooking = (e) => {
    e.preventDefault();

    const templateParams = {
      name: form.name,
      time: form.time,
      pc: form.pc,
      email: form.email, // still used in email body
      to_email: form.email, // used to send TO this address
    };

    emailjs
      .send(
        "service_h5q5lwk",
        "template_b3eg6ds",
        templateParams,
        "LEjNbva7cItXZoDDR"
      )
      .then(() => {
        alert(
          `✅ Booking confirmed for ${form.pc} at ${form.time}!\nConfirmation sent to ${form.email}`
        );
        setForm({
          pc: "",
          time: "",
          name: "",
          email: "",
        });
      })
      .catch((err) => {
        console.error("EmailJS error:", err);
        alert("❌ Booking failed. Please try again.");
      });
  };

  return (
    <div className="text-white min-h-screen bg-gray-900 pt-28 px-6 pb-20">
      <h2 className="text-3xl font-bold mb-8 text-center">
        Book Your Gaming Slot
      </h2>
      <form
        onSubmit={handleBooking}
        className="max-w-xl mx-auto bg-gray-800 p-8 rounded-lg shadow-lg space-y-6 border border-gray-700"
      >
        {/* PC Selection */}
        <div>
          <label className="block mb-2 text-sm font-medium">Select PC</label>
          <select
            name="pc"
            value={form.pc}
            onChange={handleChange}
            required
            className="w-full p-3 bg-gray-700 rounded focus:outline-none"
          >
            <option value="">-- Choose a PC --</option>
            {Array.from({ length: 10 }, (_, i) => (
              <option key={i} value={`PC ${i + 1}`}>{`PC ${i + 1}`}</option>
            ))}
          </select>
        </div>

        {/* Time Slot */}
        <div>
          <label className="block mb-2 text-sm font-medium">
            Select Time Slot
          </label>
          <select
            name="time"
            value={form.time}
            onChange={handleChange}
            required
            className="w-full p-3 bg-gray-700 rounded focus:outline-none"
          >
            <option value="">-- Choose a time --</option>
            <option value="12:00 PM - 2:00 PM">12:00 PM - 2:00 PM</option>
            <option value="2:00 PM - 4:00 PM">2:00 PM - 4:00 PM</option>
            <option value="4:00 PM - 6:00 PM">4:00 PM - 6:00 PM</option>
            <option value="6:00 PM - 8:00 PM">6:00 PM - 8:00 PM</option>
            <option value="8:00 PM - 10:00 PM">8:00 PM - 10:00 PM</option>
            <option value="10:00 PM - 12:00 AM">10:00 PM - 12:00 AM</option>
            <option value="12:00 AM - 2:00 AM">12:00 AM - 2:00 AM</option>
          </select>
        </div>

        {/* Name */}
        <div>
          <label className="block mb-2 text-sm font-medium">Your Name</label>
          <input
            type="text"
            name="name"
            value={form.name}
            onChange={handleChange}
            required
            className="w-full p-3 bg-gray-700 rounded focus:outline-none"
            placeholder="Enter your name"
          />
        </div>

        {/* Email */}
        <div>
          <label className="block mb-2 text-sm font-medium">
            Email Address
          </label>
          <input
            type="email"
            name="email"
            value={form.email}
            onChange={handleChange}
            required
            className="w-full p-3 bg-gray-700 rounded focus:outline-none"
            placeholder="you@example.com"
          />
        </div>

        {/* Submit */}
        <button
          type="submit"
          className="w-full bg-emerald-400 text-black font-bold py-3 px-6 rounded hover:bg-white transition"
        >
          Confirm Booking
        </button>
      </form>
    </div>
  );
};

export default Booking;
